import { Link } from 'react-router-dom';
import * as React from 'react';
import Stack from '@mui/material/Stack';
import Button from '@material-ui/core/Button';
import { styled } from '@mui/material/styles';
import '../index.css'
import { maxHeight, sizeHeight } from '@mui/system';



const StartPage = () => {
  return (
    <>
      <header className='startPageHeader'>
          <h2>
            Highlighting Extraction UI
          </h2>
      </header>

      <section>
        <p className='StartPageText'>
          Welcome to the Highlighting Extraction UI.
          <br></br>
          Before starting annotating, please read the Instructions first and practice using the Guided Annotation option.
        </p>
      </section>
      
      <section>
        {/* <Stack spacing={2}> */}
          <Button style={{maxWidth: '15%', maxHeight: '30%'}} component={Link} to="/instructions" variant="contained" color="primary" size="large">
            Instructions
          </Button>
          
          <Button style={{maxWidth: '15%'}} component={Link} to="/guidedAnnotation" variant="contained" color="primary" size="large">
            Guided Annotation
          </Button>

          <Button style={{maxWidth: '15%'}} component={Link} to="/annotation" variant="contained" color="primary" size="large">
            Annotation
          </Button>
        {/* </Stack> */}
      </section>
    </>
  )
}

export default StartPage
